#include <bits/stdc++.h>
using namespace std;
int main() {
    int T; cin >> T;
    while (T--) {
        int N, K; cin >> N >> K;
        string A; cin >> A;
        int suff[N];
        int zeroes = 0;
        for (int i = N-1; i >= 0; i--) {
            if (A[i] == '0') zeroes++;
            suff[i] = zeroes;
        }
        int ans = 0;
        for (int i = 0; i < N; i++) {
            int left_zeroes = i > 0 ? suff[i-1] : 0;
            int right_zeroes = suff[N-1] - suff[i];
            int can_be_one = K + right_zeroes;
            int can_be_zero = zeroes - left_zeroes;
            if (can_be_one >= can_be_zero) { ans++; }
        }
        cout << ans << endl;
    }
    return 0;
}

