import Foundation

enum Result<T> {

    case success(T)
    case error(Error)

    var isSuccessful: Bool {
        switch self {
        case .success:
            return true
        case .error:
            return false
        }
    }

    var value: T? {
        guard case .success(let value) = self else { return nil }
        return value
    }

    var error: Error? {
        guard case .error(let error) = self else { return nil }
        return error
    }

    init(_ value: T) { self = .success(value) }

    init(_ error: Error) { self = .error(error) }
}

extension Result where T: Equatable {

    static func ==(lhs: Result<T>, rhs: Result<T>) -> Bool {
        switch (lhs, rhs) {
        case (.success(let lhsValue), .success(let rhsValue)):
            return lhsValue == rhsValue
        case (.error, .error):
            return true
        default:
            return false
        }
    }
}

extension Result {

    func map<U>(_ transform: (T) -> Result<U>) -> Result<U> {
        switch self {
        case .success(let value):
            return transform(value)
        case .error(let error):
            return .error(error)
        }
    }

    func map<U>(_ transform: (T) -> U) -> Result<U> {
        map { Result(transform($0)) }
    }
}

