	public class Klotsid
	{
		public enum Suund
		{
			Vasak = -1,
			Paremal = 1,
			Paigal = 0
		}

		public enum Kuld
		{
			Sinine = 1,
			Roheline = 2,
			Punane = 3,
			Kollane = 4,
			Lilla = 5,
			Heleroheline = 6,
			Oranz = 7
		}

		public Kuld Kuld { get; set; }
		// Klotsi keskpunkt
		public Punkt Keskpunkt { get; set; }
		public List<Punkt> Kuju { get; set; }
		public bool P√∂√∂ratud { get; set; }

		public Klotsid(Kuld kuld, int x, int y)
		{
			// Suunav√§lja t√§itsime eelnevalt etteantud v√§√§rtusega
			Keskpunkt = new Punkt(x, y);
			Kuld = kuld;
			P√∂√∂ratud = false;
			// genereerime klotside kuju
			LooKlotsiKuju();
		}

		public void Liiguta(Suund suund)
		{
			// Liigutame klotse vastavas suunas
			// Kui suund on vasak, v√§hendame x-koordinaati
			// Kui suund on parem, suurendame x-koordinaati
			// Kui suund on paigal, ei liiguta
			switch (suund)
			{
				case Suund.Vasak:
					Keskpunkt.X--;
					break;
				case Suund.Paremal:
					Keskpunkt.X++;
					break;
			}
		}

		public void Langeta()
		{
			// Langeta klotse alla
			// Suurendame y-koordinaati
			Keskpunkt.Y++;
		}

		public void P√∂√∂ra()
		{
			// P√∂√∂ra klotse 90 kraadi v√µrra p√§rip√§eva
			// Leiame klotside keskpunkti
			Punkt keskpunkt = new Punkt(Keskpunkt.X, Keskpunkt.Y);
			// Loome uue klotside kuju
			List<Punkt> uusKuju = new List<Punkt>();
			// P√∂√∂rame klotse 90 kraadi v√µrra p√§rip√§eva
			foreach (Punkt punkt in Kuju)
			{
				uusKuju.Add(new Punkt(keskpunkt.X - punkt.Y + keskpunkt.Y, keskpunkt.Y + punkt.X - keskpunkt.X));
			}
			// M√§√§rame uue klotside kuju
			Kuju = uusKuju;
			// M√§√§rame, et klotsid on p√∂√∂ratud
			P√∂√∂ratud = true;
		}

		public bool KontrolliKokkup√µrget(M√§nguv√§li m√§nguv√§li)
		{
			// Kontrollime, kas klotsid puutuvad kokku teiste klotsidega v√µi m√§nguv√§lja seinaga
			// Leiame klotside keskpunkti
			Punkt keskpunkt = new Punkt(Keskpunkt.X, Keskpunkt.Y);
			// Kontrollime, kas klotsid puutuvad kokku teiste klotsidega
			foreach (Klotsid klots in m√§nguv√§li.Klotsid)
			{
				// Kui klotsid puutuvad kokku teiste klotsidega, tagastame true
				if (klots != this && klots.Kuju.Any(punkt => Kuju.Contains(punkt)))
				{
					return true;
				}
			}
			// Kontrollime, kas klotsid puutuvad kokku m√§nguv√§lja seinaga
			if (keskpunkt.X < 0 || keskpunkt.X >= m√§nguv√§li.Laius || keskpunkt.Y < 0 || keskpunkt.Y >= m√§nguv√§li.K√µrgus)
			{
				// Kui klotsid puutuvad kokku m√§nguv√§lja seinaga, tagastame true
				return true;
			}
			// Kui klotsid ei puutu kokku teiste klotsidega ega m√§nguv√§lja seinaga, tagastame false
			return false;
		}

		private void LooKlotsiKuju()
		{
			// Loome klotside kuju
			switch (Kuld)
			{
				case Kuld.Sinine:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(0, 1),
						new Punkt(1, 1)
					};
					break;
				case Kuld.Roheline:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(2, 0),
						new Punkt(2, 1)
					};
					break;
				case Kuld.Punane:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(2, 0),
						new Punkt(0, 1)
					};
					break;
				case Kuld.Kollane:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(1, 1),
						new Punkt(2, 1)
					};
					break;
				case Kuld.Lilla:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(0, 1),
						new Punkt(1, 1),
						new Punkt(2, 1)
					};
					break;
				case Kuld.Heleroheline:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(1, 1),
						new Punkt(1, 2)
					};
					break;
				case Kuld.Oranz:
					Kuju = new List<Punkt>
					{
						new Punkt(0, 0),
						new Punkt(1, 0),
						new Punkt(0, 1),
						new Punkt(0, 2)
					};
					break;
			}
		}
	}
}

