#include "map.h"
#include <iostream>

using namespace std;

Map::Map(int nRows, int nCols, int nWalls) {
	if (nCols <= MAXCOLS && nRows <= MAXROWS && nWalls <= MAXWALLS) {
		m_rows = nRows;
		m_cols = nCols;
		m_walls = nWalls;
		m_data = new int*[m_rows];
		for (int i = 0; i < m_rows; i++) {
			m_data[i] = new int[m_cols];
		}
		fillMap();
		populateMap();
	}
	else throw invalid_argument("Invalid map dimensions.");
}

Map::~Map() {
	for (int i = 0; i < m_rows; i++) {
		delete[] m_data[i];
	}
	delete[] m_data;
}

bool Map::isValid(int r, int c) {
	return (r >= 0 && r < m_rows && c >= 0 && c < m_cols);
}

void Map::fillMap() {
	for (int i = 0; i < m_rows; i++) {
		for (int j = 0; j < m_cols; j++) {
			m_data[i][j] = EMPTY;
		}
	}
}

void Map::populateMap() {
	int walls = m_walls;
	while (walls > 0) {
		int r = rand() % m_rows;
		int c = rand() % m_cols;
		if (m_data[r][c] == EMPTY) {
			m_data[r][c] = WALL;
			walls--;
		}
	}
}

int Map::get(int r, int c) {
	return m_data[r][c];
}

void Map::display(int r, int c) {
	for (int i = 0; i < m_rows; i++) {
		for (int j = 0; j < m_cols; j++) {
			if (r == i && c == j) {
				cout << "P ";
			}
			else if (m_data[i][j] == EMPTY) {
				cout << ". ";
			}
			else if (m_data[i][j] == WALL) {
				cout << "# ";
			}
		}
		cout << endl;
	}
}

import * as React from "react"
import { useStaticQuery, graphql } from "gatsby"
import { Link } from "gatsby"
import { StaticImage } from "gatsby-plugin-image"

import Layout from "../components/layout"

// styles
const markdownBodyStyles = {
  textAlign: "justify",
  textIndent: ".5rem",
}

// markup
const IndexPage = () => {
  const data = useStaticQuery(graphql`
    query {
      site {
        siteMetadata {
          title
        }
      }
      allMarkdownRemark(sort: { fields: frontmatter___date, order: DESC }) {
        nodes {
          frontmatter {
            title
            date(fromNow: true, force: true)
            path
          }
          html
          excerpt
        }
      }
    }
  `)

  return (
    <Layout title={data.site.siteMetadata.title}>
      <div className="main-container">
        <div className="homepage-banner">
          <StaticImage
            layout="fullWidth"
            alt="Mountains and lake scenery"
            src="../../static/homepage-banner_compressed.jpg"
          />
        </div>
        <div className="body">
          <h2>Blog</h2>
          <hr />
          {data.allMarkdownRemark.nodes.map(node => (
            <div key={node.id} className="blog-post">
              <Link to={node.frontmatter.path}>
                <h3>{node.frontmatter.title}</h3>
              </Link>
              <small>Posted {node.frontmatter.date}</small>
              <div
                dangerouslySetInnerHTML={{
                  __html: node.html,
                }}
                style={markdownBodyStyles}
              />
            </div>
          ))}
        </div>
      </div>
    </Layout>
  )
}

export default IndexPage

#include<stdio.h>
#include<stdlib.h>
#include<unistd.h>
#include<string.h>
#include<sys/wait.h>
#include<fcntl.h>
#include<sys/stat.h>

#define CHILD_MAX_SIZE 10

void CHerror(char *cmd) {
	perror(cmd);
	exit(-1);
}

int main() {
	pid_t childs[CHILD_MAX_SIZE];
	int child_count = 0;
	int i, j, status;
	char buf[500] = {0};

	while (1) {
		printf("$$ ");
		fgets(buf, 500, stdin);

		if (!strcmp(buf, "quit\n")) {
			printf("exit...\n");
			break;
		}

		for (j = 0; j < child_count; j++) {
			pid_t cpid = waitpid(childs[j], &status, WNOHANG);

			if (cpid != 0) {
				if (cpid == -1) {
					CHerror("waitpid()");
				}

				printf("Child Process %d returned %d\n", cpid, status);
				childs[j] = childs[child_count - 1];
				child_count--;
				j--;
			}
		}

		if (child_count >= CHILD_MAX_SIZE) {
			printf("Maximum number of child processes (%d) reached\n", CHILD_MAX_SIZE);
			continue;
		}

		for (i = 0; i < strlen(buf); i++) {
			if (buf[i] == '\n') {
				buf[i] = 0;
				break;
			}
		}

		if (buf[0] == 0) {
			continue;
		}

		int fd[2] = {0};

		switch (fork()) {
			case -1:
				CHerror("fork()");
				break;
			case 0:
				if (pipe(fd) == -1) {
					CHerror("pipe()");
				}

				pid_t cpid = fork();

				if (cpid == -1) {
					CHerror("fork()");
				}

				if (cpid == 0) {
					dup2(fd[1], 1);
					close(fd[0]);
					close(fd[1]);
					execlp(buf, buf, NULL);
					CHerror("execlp()");
				} else {
					dup2(fd[0], 0);
					close(fd[0]);
					close(fd[1]);
					execlp("more", "more", NULL);
					CHerror("execlp()");
				}
				break;
			default:
				childs[child_count] = getpid();
				child_count++;
				break;
		}
	}

	for (i = 0; i < child_count; i++) {
		waitpid(childs[i], &status, 0);
	}

	return 0;
}

import { Effect } from './Effect'
import { EffectBuilder } from './EffectBuilder'

export interface BuilderWeakMap {
  [key: string]: EffectBuilder
}

export class EffectBuilders {
  private static readonly instance = new EffectBuilders()

  private builderWeakMap: BuilderWeakMap = {}

  private constructor() {}

  static getInstance(): EffectBuilders {
    return this.instance
  }

  getEffectBuilder(effectName: string): EffectBuilder | undefined {
    return this.builderWeakMap[effectName]
  }

  addEffectBuilder(effectName: string, builder: EffectBuilder): void {
    this.builderWeakMap[effectName] = builder
  }

  build(effectName: string): Effect {
    const builder = this.getEffectBuilder(effectName)
    if (!builder) throw new Error(`Effect with name ${effectName} does not exist.`)

    return builder.build()
  }
}

