public class ClassOverview {

    //Class level variable
    //accessible to all methods in the class
    private static int s_number = 10;

    //Class level method
    //Accessible to all methods in the class
    public static int adjustNumber() {
        return s_number += 30;
    }

    // instance variable
    //accessible to all methods in the object.
    private int i_number = 15;

    //Instance method
    //Accessible to only the instance of this object.
    public void printNumber() {
        System.out.println("Instance variable: " + i_number);
    }

    //Method to set the value of the instance variable
    public void setNumber(int value) {
        this.i_number = value;
    }

    //Default Constructor
    //Executes when a new instance of the class is created.
    public ClassOverview() {
        System.out.println("constructor executed");
    }

    //Method to return the value of the class level variable
    public int getNumber() {
        return s_number;
    }
}

