package maze;

import java.util.ArrayList;
import java.util.LinkedList;
import java.util.Queue;

import algo.Node;
import static maze.MazeMarkers.*;

public class Maze {
	// this array of MazeMarkers defines the maze
	private MazeMarkers[][] maze;
	private ArrayList<Node<MazeMarkers>> path;
	public enum MazeMarkers {
		WALL, SPACE, GOAL, START
	}

	// size is the number of rows/columns in the maze
	public Maze(int size) {
		path = new ArrayList<>();
		maze = new MazeMarkers[size][size];
		for (int i = 0; i < size; i++)
			for (int j = 0; j < size; j++) {
				maze[i][j] = (int) (Math.random() * 4) == 3 ? WALL : SPACE;
			}
		maze[0][0] = START;
		maze[size - 1][size - 1] = GOAL;
	}

	// return the size of the maze
	public int size() {
		return maze.length;
	}

	// get the value of the space at coordinates [i][j]
	public MazeMarkers get(int i, int j) {
		return maze[i][j];
	}

	// set the value of the space at coordinates [i][j]
	public void set(int i, int j, MazeMarkers mazeMarker) {
		maze[i][j] = mazeMarker;
	}

	// is the space at coordinates [i][j] marked as a wall
	public boolean isWall(int i, int j) {
		return maze[i][j] == WALL;
	}

	// is the space at coordinates [i][j] marked as the goal
	public boolean isGoal(int i, int j) {
		return maze[i][j] == GOAL;
	}

	// is the space at coordinates [i][j] marked as the start point
	public boolean isStart(int i, int j) {
		return maze[i][j] == START;
	}

	// is the space at coordinates [i][j] marked as a space
	public boolean isSpace(int i, int j) {
		return !isWall(i, j) && !isStart(i, j) && !isGoal(i, j);
	}

	// print the maze in a human-readable format
	public void print() {
		System.out.println(this);
	}

	// return a string representation of the maze
	public String toString() {
		StringBuilder sb = new StringBuilder(maze.length * (maze.length + 1));
		for (MazeMarkers[] row : maze) {
			for (MazeMarkers space : row) {
				switch (space) {
					case WALL:
						sb.append("#");
						break;
					case SPACE:
						sb.append(" ");
						break;
					case GOAL:
						sb.append("G");
						break;
					case START:
						sb.append("S");
						break;
				}
			}
			sb.append('\n');
		}
		return sb.toString();
	}

	// find the path from the start point to the goal using a breadth-first search (BFS)
	public ArrayList<Node<MazeMarkers>> solve() {
		path.clear();
		// create a queue to store the nodes to be visited
		Queue<Node<MazeMarkers>> queue = new LinkedList<>();
		// create a 2D array to store the visited nodes
		boolean[][] visited = new boolean[maze.length][maze.length];
		// add the start node to the queue
		queue.add(new Node<>(maze[0][0]));
		// while the queue is not empty, keep searching for the goal
		while (!queue.isEmpty()) {
			// get the next node from the queue
			Node<MazeMarkers> node = queue.remove();
			// if the node is the goal, return the path
			if (isGoal(node.getData().row, node.getData().column)) {
				getPath(node);
				return path;
			}
			// mark the node as visited
			visited[node.getData().row][node.getData().column] = true;
			// add the node's neighbors to the queue
			for (Node<MazeMarkers> neighbor : neighbors(node)) {
				if (!visited[neighbor.getData().row][neighbor.getData().column]) {
					queue.add(neighbor);
				}
			}
		}
		// if the goal was not found, return null
		return null;
	}

	// get the neighbors of a node
	private ArrayList<Node<MazeMarkers>> neighbors(Node<MazeMarkers> node) {
		ArrayList<Node<MazeMarkers>> neighbors = new ArrayList<>();
		// get the coordinates of the node
		int i = node.getData().row;
		int j = node.getData().column;
		// add the neighbor to the north
		if (i > 0 && isSpace(i - 1, j)) {
			neighbors.add(new Node<>(maze[i - 1][j]));
		}
		// add the neighbor to the south
		if (i < maze.length - 1 && isSpace(i + 1, j)) {
			neighbors.add(new Node<>(maze[i + 1][j]));
		}
		// add the neighbor to the west
		if (j > 0 && isSpace(i, j - 1)) {
			neighbors.add(new Node<>(maze[i][j - 1]));
		}
		// add the neighbor to the east
		if (j < maze.length - 1 && isSpace(i, j + 1)) {
			neighbors.add(new Node<>(maze[i][j + 1]));
		}
		return neighbors;
	}

	// get the path from the start point to the goal
	private void getPath(Node<MazeMarkers> node) {
		while (node != null) {
			path.add(0, node);
			node = node.getParent();
		}
	}
}

import { Avatar, Button, Card, CardContent, CardHeader, CircularProgress, Divider, Grid, Typography } from '@mui/material';
import { Box } from '@mui/system';
import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { clearErrorMessage, getProfile, updateProfile } from '../../store/user/user.action';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from 'yup';
