import { toast } from 'react-hot-toast';
const schema = yup.object().shape({
    name: yup.string().required(),
    email: yup.string().email().required(),
    major: yup.string().required(),
    semester: yup.string().required(),
    cvLink: yup.string(),
    aboutMe: yup.string(),
    profileImage: yup.mixed(),
});

const Profile = () => {
    const [loading, setLoading] = useState(false);
    const user = useSelector(state => state.user)
    const dispatch = useDispatch();
    const navigate = useNavigate();
    useEffect(() => {
        dispatch(getProfile())
    }, [dispatch]);
    useEffect(() => {
        if (user.error) {
            toast.error(user.error, {
                duration: 4000,
                position: 'top-right',
            });
            dispatch(clearErrorMessage())
        }
    }, [user.error, dispatch])
    const { register, handleSubmit, setValue, formState: { errors } } = useForm({ resolver: yupResolver(schema) });
    useEffect(() => {
        if (user.profile) {
            setValue('name', user.profile.name)
            setValue('email', user.profile.email)
            setValue('major', user.profile.major)
            setValue('semester', user.profile.semester)
            setValue('cvLink', user.profile.cvLink)
            setValue('aboutMe', user.profile.aboutMe)
