import React,{useEffect} from 'react'
import { Link } from 'react-router-dom'
import {useSelector,useDispatch} from 'react-redux'
import {addtocart,remove,inc,dec} from '../Actions/cartActions'

const Card = ({id,name,img,price,qty,stock,increase=false,decrease=false,view}) => {
    const dispatch=useDispatch()
    const {addItem}=useSelector(state=>state.cartItems)

    useEffect(() => {
        addItem && addItem.length && addItem.map((item)=>(
        id===item.id && dispatch(inc(item.qty))
        ))
    }, [addItem,id,dispatch])
    return (
        <div>
            <div className="card" style={{width: "18rem"}}>
                <Link to={`/product/${id}`}>
                    <img src={img} className="card-img-top" alt="..." />
                </Link>
                <div className="card-body">
                    <h5 className="card-title">{name}</h5>
                    <p className="card-text">‚Çπ {price}</p>
                    <div className="card-text">
                        <Link to={`/product/${id}`} className="btn btn-info">View</Link>&nbsp;
                       {view===true?<button className="btn btn-secondary" onClick={()=>dispatch(addtocart(id,name,price,1,img,qty,stock))}>Add</button>:""}
                    </div>
                        <div className="card-text">
                            <button className="btn btn-primary" onClick={()=>dispatch(dec(id))}>-</button>&nbsp;
                            {qty}&nbsp;
                            <button className="btn btn-primary" onClick={()=>dispatch(inc(id))}>+</button>
                        </div>
                        <div>
                        <button className="btn btn-danger" onClick={()=>dispatch(remove(id))}><i className="fas fa-trash-alt"></i></button>
                        </div>
                </div>
            </div>
        </div>
    )
}

