namespace UnityStandardAssets._2D
{
    //----------------------------------------------------------------------------------------------------------------------------------------------------------------
    public class Shuriken : MonoBehaviour
    {
        //----------------------------------------------------------------------------------------------------------------------------------------------------------------
        public AudioClip enemyHitSound;
        public AudioClip shurikenHitSound;
        public AudioClip shurikenShotSound;
        public AudioClip specialAttackSound;

        public float shurikenSpeed;
        public bool playerOnLeft;

        public Transform player;
        public Transform target;
        public float shurikenDistance;
        public float timeToTravel;
        public float angle;
        public float startTime;

        bool isHit;
        bool hasTarget;
        bool returnToPlayer;
        bool isPlayerAttacking;

        public Animator anim;
        public Rigidbody2D rb;

        GameObject playerGO;
        GameObject enemyGO;
        AudioSource audioS;

        private void OnEnable()
        {
            // Take the player transform from the player game object
            player = GameObject.FindGameObjectWithTag("Player").GetComponent<Transform>();

            // Check if we've encountered an enemy, which is what we will attack
            enemyGO = GameObject.FindGameObjectWithTag("Enemy");

            if (enemyGO != null)
            {
                target = enemyGO.GetComponent<Transform>();
            }

            playerGO = GameObject.FindGameObjectWithTag("Player");
            audioS = GetComponent<AudioSource>();
            isHit = false;
            hasTarget = false;
            startTime = Time.time;
            returnToPlayer = false;
            isPlayerAttacking = false;
            anim = GetComponent<Animator>();
        }

        // Update is called once per frame
        private void Update()
        {
            timeToTravel = (shurikenDistance / shurikenSpeed);
            if (playerGO.GetComponent<Player>().isAttacking)
            {
                anim.SetTrigger("Throw");
                audioS.PlayOneShot(shurikenShotSound);
                isPlayerAttacking = true;
            }
        }

        private void FixedUpdate()
        {
            ManageRotation();
            MoveShuriken();
            Invoke("DestroyShuriken", timeToTravel);
        }

        void MoveShuriken()
        {
            if (isPlayerAttacking)
            {
                rb.velocity = new Vector2(Mathf.Cos(Mathf.Deg2Rad * angle), Mathf.Sin(Mathf.Deg2Rad * angle)) * shurikenSpeed;
            }
        }
        //----------------------------------------------------------------------------------------------------------------------------------------------------------------
        void ManageRotation()
        {
            if (playerOnLeft && !returnToPlayer)
            {
                angle = Mathf.Atan2(target.position.y - transform.position.y, target.position.x - transform.position.x) * Mathf.Rad2Deg + 180;
            }
            else if (!playerOnLeft && !returnToPlayer)
            {
                angle = Mathf.Atan2(target.position.y - transform.position.y, target.position.x - transform.position.x) * Mathf.Rad2Deg;
            }

            if (returnToPlayer)
            {
                if (playerOnLeft)
                {
                    angle = Mathf.Atan2(player.position.y - transform.position.y, player.position.x - transform.position.x) * Mathf.Rad2Deg + 180;
                }
                else
                {
                    angle = Mathf.Atan2(player.position.y - transform.position.y, player.position.x - transform.position.x) * Mathf.Rad2Deg;
                }

                shurikenSpeed += 5 * Time.deltaTime;
            }

            transform.rotation = Quaternion.AngleAxis(angle, Vector3.forward);
        }
        //----------------------------------------------------------------------------------------------------------------------------------------------------------------
        private void OnCollisionEnter2D(Collision2D collision)
        {
            if (collision.gameObject.tag == "Enemy")
            {
                isHit = true;
                audioS.PlayOneShot(enemyHitSound);
            }

            if (collision.gameObject.tag == "Player" && returnToPlayer)
            {
                isHit = true;
                audioS.PlayOneShot(shurikenHitSound);
            }
        }

        private void DestroyShuriken()
        {
            if (isHit || Time.time - startTime > timeToTravel)
            {
                if (!returnToPlayer)
                {
                    rb.velocity = new Vector2(0, 0);
                }

                Invoke("ReturnShuriken", 1.5f);
            }
        }

        private void ReturnShuriken()
        {
            hasTarget = true;

            // Sets the speed to go back to the player so that the shuriken can travel in the given time
            shurikenSpeed = shurikenDistance / timeToTravel;

            returnToPlayer = true;
        }

        private void ShurikenIsBack()
        {
            transform.position = new Vector2(player.position.x, player.position.y - 1);
            returnToPlayer = false;
            rb.velocity = new Vector2(0, 0);
            gameObject.SetActive(false);
        }

        public void SpecialAttack()
        {
            audioS.PlayOneShot(specialAttackSound);
        }
    }
}

