using ll = long long;
using ii = pair<int, int>;
const int inf = numeric_limits<int>::max();

int main() {
  ios::sync_with_stdio(false);
  cin.tie(0);

  // initialize: 4 kinds * 2 = 8
  vector<vector<ll>> dp(8, vector<ll>(2));
  dp[0][0] = 1;
  for (int i = 1; i < 8; i++) {
    if (i % 2 == 1) {
      dp[i][0] = dp[i - 1][0] * 2;
      dp[i][1] = dp[i - 1][1] * 2;
    } else {
      dp[i][0] = dp[i - 1][0] + dp[i - 1][1];
      dp[i][1] = dp[i - 1][1] + dp[i - 1][0];
    }
  }

  int n, m;
  while (cin >> n >> m, n + m != 0) {
    switch (n) {
      case 1:
        cout << dp[m][0] + dp[m][1] << '\n';
        break;
      case 2:
        cout << dp[m][0] << '\n';
        break;
      case 3:
        cout << dp[m][1] << '\n';
        break;
      case 4:
        cout << dp[m][0] + dp[m][1] << '\n';
        break;
    }
  }

  return 0;
}

