function serialize(array){
return array.map(function(a){
if (a === null || a == undefined) {
return a;
} else if (a.constructor == Date) {
return a.toISOString();
} else if (a.constructor == RegExp) {
return a.toString();
} else if (a.constructor == ArrayBuffer) {
return arrayBuffer.slice(0, arrayBuffer.byteLength);
} else if (a.constructor == Float64Array) {
return JSON.stringify(%.6f, a);
} else if (a.constructor == Int16Array || a.constructor == Int32Array || a.constructor == Int8Array) {
return JSON.stringify(a);
} else if (a.constructor == Uint16Array || a.constructor == Uint32Array || a.constructor == Uint8Array) {
return JSON.stringify(a);
} else if (a.constructor == HTMLImageElement) {
return a.src;
} else if (a.constructor == HTMLCanvasElement) {
return a.toDataURL();
} else {
return JSON.stringify(a);
}
});
