		//Static nested class or inner class
		MyOuter.StaticNested sN=new MyOuter.StaticNested(10, 20);
		sN.display();

		//Non-Static or regular inner class
		MyOuter myOuter=new MyOuter();
		myOuter.display();
		myOuter.show();

		// Local inner class
		class LocalInner{
			private int x,y;

			public LocalInner(int x, int y) {
				this.x = x;
				this.y = y;
			}
			public void display() {
				System.out.println("X : "+x+" Y : "+y);
			}
		}

		LocalInner localInner=new LocalInner(30, 40);
		localInner.display();


		//Anonymous inner class

		Runnable r=new Runnable() {
			public void run() {
				for(int i=0;i<3;i++) {
					System.out.println("Child Thread "+i);
				}
			}
		};

