class MyOuter{

	private int x,y;


	public MyOuter() {
		x=10;
		y=20;
		System.out.println("Constructor of Outer class is called!");
	}

	public void display() {
		System.out.println("X : "+x+" Y : "+y);
	}

	public void show() {
		//Local inner class
		class LocalInner{
			private int x,y;

			public LocalInner(int x, int y) {
				this.x = x;
				this.y = y;
			}
			public void display() {
				System.out.println("X : "+x+" Y : "+y);
			}
		}

		LocalInner localInner=new LocalInner(30, 40);
		localInner.display();
	}

	// Static nested class
	static class StaticNested{
		private int x,y;

		public StaticNested(int x, int y) {
			this.x = x;
			this.y = y;
			System.out.println("Constructor of static nested class is called!");
		}
		public void display() {
			System.out.println("X : "+x+" Y : "+y);
		}
	}
	//Non static inner class
	public class NonStaticInner{
		private int x,y;

		public NonStaticInner(int x, int y) {
			this.x = x;
			this.y = y;
			System.out.println("Constructor of Non static class is called!");
		}
		public void display() {
			System.out.println("X : "+x+" Y : "+y);
		}
	}
}

