using Serilog;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using YahooFinanceApi;

namespace StockCompare
{
    class Program
    {
        private const string _appTitle = "Stock Compare";
        private const string _appVersion = "1.0.0";

        static void Main(string[] args)
        {
            // Configure logging
            Log.Logger = new LoggerConfiguration()
                .WriteTo.Console()
                .CreateLogger();

            // Create a list of the symbols to be used
            List<string> symbols = new List<string>();
            for (int i = 0; i < args.Length; i++)
            {
                symbols.Add(args[i]);
            }

            if (symbols.Count <= 1)
            {
                ShowUsage();
                return;
            }

            // Create a list of stock prices
            List<StockPrice> stockPrices = new List<StockPrice>();
            for (int i = 0; i < symbols.Count; i++)
            {
                var symbol = symbols[i];
                try
                {
                    var stockPrice = YahooFinance.GetStockPrice(symbol).Result;
                    stockPrices.Add(stockPrice);
                }
                catch (Exception ex)
                {
                    Log.Error(ex, "Unable to get stock price for \"{symbol}\"", symbol);
                    return;
                }
            }

            // Sort the stock prices by price
            stockPrices.Sort((x, y) => x.Price.CompareTo(y.Price));

            // Output the results
            Console.Title = _appTitle;
            Console.WriteLine($"{_appTitle} v{_appVersion}");
            Console.WriteLine("-----------------");
            foreach (var stockPrice in stockPrices)
            {
                Console.WriteLine($"Symbol: {stockPrice.Symbol}");
                Console.WriteLine($"Name: {stockPrice.Name}");
                Console.WriteLine($"Price: {stockPrice.Price}");
                Console.WriteLine($"Percentage Change: {stockPrice.PercentageChange}%");
                Console.WriteLine();
            }
        }

        private static void ShowUsage()
        {
            Console.Title = _appTitle;
            Console.WriteLine($"{_appTitle} v{_appVersion}");
            Console.WriteLine("-----------------");
            Console.WriteLine("Usage:");
            Console.WriteLine("StockCompare <symbol1> <symbol2> ...");
            Console.WriteLine();
            Console.WriteLine("Example:");
            Console.WriteLine("StockCompare AAPL GOOGL MSFT");
        }
    }
}

