package com.mercadolibre.productsearch;

import com.mercadolibre.productsearch.domain.model.PaginatedData;
import com.mercadolibre.productsearch.domain.model.Product;
import com.mercadolibre.productsearch.domain.repository.ProductRepository;
import com.mercadolibre.productsearch.domain.service.ProductService;
import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.mockito.Mockito;

import java.util.ArrayList;
import java.util.List;

public class ProductServiceUnitTest {

    public static final String FIRST_PRODUCT_NAME = "first product";
    public static final String SECOND_PRODUCT_NAME = "second product";
    public static final Double FIRST_PRODUCT_PRICE = 100.0;
    public static final Double SECOND_PRODUCT_PRICE = 200.0;
    public static final Double FIRST_PRODUCT_SHIPPING = 15.0;
    public static final Double SECOND_PRODUCT_SHIPPING = 25.0;
    public static final Double FIRST_PRODUCT_RATING = 4.8;
    public static final Double SECOND_PRODUCT_RATING = 4.9;
    public static final Integer FIRST_PRODUCT_SOLD = 1000;
    public static final Integer SECOND_PRODUCT_SOLD = 2000;
    public static final Boolean FIRST_PRODUCT_IS_FREE_SHIPPING = true;
    public static final Boolean SECOND_PRODUCT_IS_FREE_SHIPPING = false;
    public static final List<String> FIRST_PRODUCT_ADDRESSES = List.of("address 1", "address 2");
    public static final List<String> SECOND_PRODUCT_ADDRESSES = List.of("address 3", "address 4");

    private ProductRepository productRepository;
    private ProductService productService;

    @BeforeEach
    void setUp() {
        productRepository = Mockito.mock(ProductRepository.class);
        productService = new ProductService(productRepository);
    }

    @Test
    void testFindById() {
        //Given
        Product product = Product.builder()
                .name(FIRST_PRODUCT_NAME)
                .price(FIRST_PRODUCT_PRICE)
                .shipping(FIRST_PRODUCT_SHIPPING)
                .rating(FIRST_PRODUCT_RATING)
                .sold(FIRST_PRODUCT_SOLD)
                .freeShipping(FIRST_PRODUCT_IS_FREE_SHIPPING)
                .addresses(FIRST_PRODUCT_ADDRESSES)
                .build();
        Mockito.when(productRepository.findById(1L)).thenReturn(product);

        //When
        Product result = productService.findById(1L);

        //Then
        Assertions.assertEquals(product, result);
    }

    @Test
    void testFindAll() {
        //Given
        List<Product> products = new ArrayList<>();
        products.add(Product.builder()
                .name(FIRST_PRODUCT_NAME)
                .price(FIRST_PRODUCT_PRICE)
                .shipping(FIRST_PRODUCT_SHIPPING)
                .rating(FIRST_PRODUCT_RATING)
                .sold(FIRST_PRODUCT_SOLD)
                .freeShipping(FIRST_PRODUCT_IS_FREE_SHIPPING)
                .addresses(FIRST_PRODUCT_ADDRESSES)
                .build());
        products.add(Product.builder()
                .name(SECOND_PRODUCT_NAME)
                .price(SECOND_PRODUCT_PRICE)
                .shipping(SECOND_PRODUCT_SHIPPING)
                .rating(SECOND_PRODUCT_RATING)
                .sold(SECOND_PRODUCT_SOLD)
                .freeShipping(SECOND_PRODUCT_IS_FREE_SHIPPING)
                .addresses(SECOND_PRODUCT_ADDRESSES)
                .build());
        Mockito.when(productRepository.findAll()).thenReturn(products);

        //When
        PaginatedData<Product> result = productService.findAll(0, 10);

        //Then
        Assertions.assertEquals(products, result.getData());
        Assertions.assertEquals(2, result.getTotal());
    }

    @Test
    void testCreateProduct() {
        //Given
        Product product = Product.builder()
                .name(FIRST_PRODUCT_NAME)
                .price(FIRST_PRODUCT_PRICE)
                .shipping(FIRST_PRODUCT_SHIPPING)
                .rating(FIRST_PRODUCT_RATING)
                .sold(FIRST_PRODUCT_SOLD)
                .freeShipping(FIRST_PRODUCT_IS_FREE_SHIPPING)
                .addresses(FIRST_PRODUCT_ADDRESSES)
                .build();
        Mockito.when(productRepository.save(product)).thenReturn(product);

        //When
        Product result = productService.create(product);

        //Then
        Assertions.assertEquals(product, result);
    }

    @Test
    void testUpdateProduct() {
        //Given
        Product product = Product.builder()
                .id(1L)
                .name(FIRST_PRODUCT_NAME)
                .price(FIRST_PRODUCT_PRICE)
                .shipping(FIRST_PRODUCT_SHIPPING)
                .rating(FIRST_PRODUCT_RATING)
                .sold(FIRST_PRODUCT_SOLD)
                .freeShipping(FIRST_PRODUCT_IS_FREE_SHIPPING)
                .addresses(FIRST_PRODUCT_ADDRESSES)
                .build();
        Mockito.when(productRepository.save(product)).thenReturn(product);
        Mockito.when(productRepository.findById(1L)).thenReturn(product);

        //When
        Product result = productService.update(product, 1L);

        //Then
        Assertions.assertEquals(product, result);
    }

    @Test
    void testDeleteProduct() {
        //Given
        Mockito.doNothing().when(productRepository).deleteById(1L);

        //When
        productService.delete(1L);

        //Then
        Mockito.verify(productRepository, Mockito.times(1)).deleteById(1L);
    }
}

