package net.minecraft.network.play.server;

import java.io.IOException;
import net.minecraft.network.Packet;
import net.minecraft.network.PacketBuffer;
import net.minecraft.network.play.INetHandlerPlayClient;

public class SPacketPlayerListHeaderFooter implements Packet<INetHandlerPlayClient> {
   private String header;
   private String footer;

   public SPacketPlayerListHeaderFooter() {
   }

   public SPacketPlayerListHeaderFooter(String headerIn, String footerIn) {
      this.header = headerIn;
      this.footer = footerIn;
   }

   public void readPacketData(PacketBuffer buf) throws IOException {
      this.header = buf.readStringFromBuffer(32767);
      this.footer = buf.readStringFromBuffer(32767);
   }

   public void writePacketData(PacketBuffer buf) throws IOException {
      buf.writeString(this.header);
      buf.writeString(this.footer);
   }

   public void processPacket(INetHandlerPlayClient handler) {
      handler.handlePlayerListHeaderFooter(this);
   }

   public String getHeader() {
      return this.header;
   }

   public String getFooter() {
      return this.footer;
   }
}

