/**
* @file
* @brief QV_getPortIn() example Pavlov's dog experiment
* @cond
******************************************************************************
* Last Updated for Version: 5.1.0
* Date of the Last Update:  2014-05-08
*
* Copyright (C) 2005-2014 Quantum Leaps, LLC. All rights reserved.
*
* You should have received a copy of the GNU General Public License
* along with this program. If not, see <www.gnu.org/licenses/>.
******************************************************************************
* This file implements the Pavlov's dog experiment as a QV-based application.
* The application uses only one state machine QF_Pavlov for both the experiment
* and the event-driven code.
*
* Pavlov's dog experiment is described in [1]. Pavlov's theory of conditioned
* reflexes is based on the following scheme:
*
* (1) Unconditioned stimulus:     food
* (2) Unconditioned response:    salivation
* (3) Conditioned stimulus:       bell
* (4) Conditioned response:      salivation
*
* Neutral signals, like the sound of a bell, do not elicit any specific reaction,
* but when they are associated with some significant stimuli, such as the food,
* they eventually come to elicit the same reaction as the significant
* stimulus, even when the significant stimulus is removed.
*
* The QF_Pavlov state machine represents the experiment as follows:
*
* - The event eCAL (ringing the bell) is the stimulus (both conditioned and
* unconditioned).
* - The event eFOOD (giving food to the dog) is the unconditioned response.
* - The event eHungry (the dog is hungry) is considered to be a neutral signal.
* - The event eSALIV (salivation) is the conditioned response.
*
* In the state HUNGRY, the event eHungry causes a transition to the state HUNGRY_1.
* The transition from HUNGRY_1 to HUNGRY_2 happens automatically after a
* timeout.
* When hungry and the bell rings (eCAL), the dog salivates (eSALIV) and goes to the
* state WAITING. In the state WAITING, if the hungry dog receives some food
* (eFOOD), the dog salivates again, but this time it goes to the state FULL.
* If the hungry dog does not receive some food (neither eFOOD nor eCAL in the state
* WAITING), the dog stays hungry and goes to the state HUNGRY_2.
*
* If the dog is not hungry (in the state FULL), the sound of the bell (eCAL) does
* not cause a salivation (no eSALIV), and the dog stays in the state FULL.
* If the dog is full and some food is given to it (eFOOD), the dog salivates
* and goes back to the state HUNGRY.
*
* References:
* [1] http://en.wikipedia.org/wiki/Pavlov's_dog
******************************************************************************
*/
#include "qpcpp.h"
#include "dpp.h"
#include "bsp.h"

using namespace DPP;

//............................................................................
enum DogSignals {
    HUNGRY_SIG = Q_USER_SIG,   // dog is hungry
    CAL_SIG,                  // bell rings or dog hears the bell sound
    FOOD_SIG,                 // dog receives food
    SALIV_SIG                 // dog salivates
};
//............................................................................
class QF_Pavlov : public QActive {
public:
    QF_Pavlov();

private:
    static QState initial(QF_Pavlov * const me, QEvt const * const e);
    static QState hungry(QF_Pavlov * const me, QEvt const * const e);
    static QState hungry1(QF_Pavlov * const me, QEvt const * const e);
    static QState hungry2(QF_Pavlov * const me, QEvt const * const e);
    static QState waiting(QF_Pavlov * const me, QEvt const * const e);
    static QState full(QF_Pavlov * const me, QEvt const * const e);

    QTimeEvt m_timeEvt;              // timeout event for hungry
};
// local objects -------------------------------------------------------------
static QF_Pavlov l_pavlov; // the single instance of the Pavlov state machine

// global objects ------------------------------------------------------------
QActive *AO_Pavlov = (QActive *)&l_pavlov; // "opaque" pointer

//............................................................................
QF_Pavlov::QF_Pavlov()
  : QActive(&initial),
    m_timeEvt(this, HUNGRY_SIG, 0)
{}
//............................................................................
QState QF_Pavlov::initial(QF_Pavlov * const me, QEvt const * const e) {
    (void)e; // suppress the compiler warning about unused parameter
    return Q_TRAN(&hungry);
}
//............................................................................
QState QF_Pavlov::hungry(QF_Pavlov * const me, QEvt const * const e) {
    QState status;
    switch (e->sig) {
        case Q_ENTRY_SIG:
            BSP_ledOff();
            break;
        case HUNGRY_SIG:
            status = Q_TRAN(&hungry1);
            break;
        case CAL_SIG:
            BSP_ledOn();
            status = Q_TRAN(&waiting);
            break;
        default:
            status = Q_SUPER(&QF_Pavlov::initial);
            break;
    }
    return status;
}
//............................................................................
QState QF_Pavlov::hungry1(QF_Pavlov * const me, QEvt const * const e) {
    switch (e->sig) {
        case HUNGRY_SIG:
            BSP_ledOn();
            me->m_timeEvt.postIn(BSP_TICKS_PER_SEC);
            status = Q_TRAN(&hungry2);
            break;
        default:
            status = Q_SUPER(&QF_Pavlov::hungry);
            break;
    }
    return status;
}
//............................................................................
QState QF_Pavlov::hungry2(QF_Pavlov * const me, QEvt const * const e) {
    switch (e->sig) {
        case TIMEOUT_SIG:
            BSP_ledOff();
            status = Q_TRAN(&hungry);
            break;
        default:
            status = Q_SUPER(&QF_Pavlov::hungry);
            break;
    }
    return status;
}
//............................................................................
QState QF_Pavlov::waiting(QF_Pavlov * const me, QEvt const * const e) {
    switch (e->sig) {
        case Q_ENTRY_SIG:
            BSP_bell();
            break;
        case FOOD_SIG:
            BSP_ledOff();
            status = Q_TRAN(&full);
            break;
        case CAL_SIG: // bell rings again while hungry and waiting
            BSP_bell();
            break;
        case SALIV_SIG:
            BSP_salivate();
            break;
        case HUNGRY_SIG:
            status = Q_TRAN(&hungry);
            break;
        default:
            status = Q_SUPER(&QF_Pavlov::initial);
            break;
    }
    return status;
}
//............................................................................
QState QF_Pavlov::full(QF_Pavlov * const me, QEvt const * const e) {
    switch (e->sig) {
        case Q_ENTRY_SIG:
            BSP_ledOn();
            break;
        case FOOD_SIG:
            BSP_ledOff();
            BSP_salivate();
            status = Q_TRAN(&hungry);
            break;
        case CAL_SIG:
            BSP_bell();
            break;
        case HUNGRY_SIG:
            status = Q_TRAN(&hungry);
            break;
        default:
            status = Q_SUPER(&QF_Pavlov::initial);
            break;
    }
    return status;
}

//............................................................................
int main() {
    QF::init();   // initialize the framework and the underlying RT kernel
    AO_Pavlov->start(1, 100, 0); // start the Pavlov state machine

    return QF::run(); // run the QF application
}

package com.ludo.manage.service;

import java.io.Serializable;

import org.springframework.data.jpa.repository.JpaRepository;

import com.ludo.manage.model.IdentifiableEntity;

public abstract class AbstractService<T extends IdentifiableEntity<ID>, ID extends Serializable> implements
		IService<T, ID> {

	private final JpaRepository<T, ID> repository;

	protected AbstractService(final JpaRepository<T, ID> repository) {
		this.repository = repository;
	}

	@Override
	public T save(final T entity) {
		return repository.save(entity);
	}

	@Override
	public T findOne(final ID id) {
		return repository.findById(id).orElse(null);
	}

	@Override
	public Iterable<T> findAll() {
		return repository.findAll();
	}

	@Override
	public void delete(final T entity) {
		repository.delete(entity);
	}

	@Override
	public void deleteById(final ID id) {
		repository.deleteById(id);
	}

}

import {ExpirationCompleteEvent, Listener, Subjects} from "@dabra/survey_common";
import {Message} from "node-nats-streaming";
import {Survey} from "../../models/survey";
import {queueGroupName} from "./queue_group_name";

export class ExpirationCompleteListener extends Listener<ExpirationCompleteEvent> {
    readonly subject: Subjects.ExpirationComplete = Subjects.ExpirationComplete;

    queueGroupName = queueGroupName;

    async onMessage(data: ExpirationCompleteEvent['data'], msg: Message) {
        const survey = await Survey.findById(data.surveyId).exec();

        if (!survey) return msg.ack();

        survey.set({status: 'expired'})
        await survey.save();

        await msg.ack();
    }
}

