const fs = require('fs')
const path = require('path')

function isNativeType(type) {
  return ['String', 'Number', 'Boolean'].indexOf(type) >= 0
}

function formatType(type) {
  return type.charAt(0).toLowerCase() + type.slice(1)
}

const typeMap = {
  String: 'string',
  Number: 'number',
  Boolean: 'boolean'
}

function parseType(type) {
  if (isNativeType(type)) {
    return typeMap[type] || type
  }

  return type.replace(/\[\]$/, '').replace(/^\[/, '').replace(/\]$/, '')
}

function parseComment(comment) {
  if (!comment) {
    return
  }

  const lines = comment.split('\n')
  const description = lines.shift().trim()

  const propComments = {}
  lines.forEach(line => {
    if (line.indexOf('* @prop ') === 0) {
      const propName = line.match(/\* @prop (.*)/)[1]
      const propComment = line.replace(/\* @prop .* /, '').trim()
      propComments[propName] = propComment
    }
  })

  return {
    description,
    propComments
  }
}

function parseInterface(ast) {
  const name = ast.id.name
  const members = ast.body.body

  const props = members
    .filter(m => m.type === 'PropertyDefinition')
    .map(m => {
      const key = m.key && m.key.name
      const value = m.value
      const type = parseType(value.typeAnnotation.typeAnnotation.name)
      const comment = parseComment(m.leadingComments && m.leadingComments[0].value)

      return {
        key,
        value: {
          type,
          default: value.initializer ? value.initializer.value : null,
          required: !m.optional,
          description: comment && comment.description,
          propComment: comment && comment.propComments && comment.propComments[key]
        }
      }
    })

  return {
    name,
    props
  }
}

function readTsFiles(dirPath) {
  const files = fs.readdirSync(dirPath)
  const astFiles = []

  files.forEach(file => {
    const filePath = path.resolve(dirPath, file)
    if (file.endsWith('.ts')) {
      astFiles.push(filePath)
    } else if (fs.lstatSync(filePath).isDirectory()) {
      astFiles.push(...readTsFiles(filePath))
    }
  })

  return astFiles
}

function isValidInterface(ast) {
  if (ast.type !== 'InterfaceDeclaration') {
    return false
  }

  if (!ast.body || ast.body.body.length === 0) {
    return false
  }

  return true
}

exports.readInterfaces = (dirPath) => {
  const astFiles = readTsFiles(dirPath)
  const interfaces = []

  astFiles.forEach((file) => {
    const source = fs.readFileSync(file, 'utf8')
    const ast = require('ts-pragmas').parse(source, {
      target: 2,
      moduleResolution: 2,
      module: 1
    })

    ast.body.forEach(node => {
      if (isValidInterface(node)) {
        interfaces.push(parseInterface(node))
      }
    })
  })

  return interfaces
}

exports.typeNameMap = {
  String: 'string',
  Number: 'number',
  Boolean: 'boolean',
  '*': 'any'
}

exports.escapeQuotes = str => {
  return str.replace(/"/g, '&quot;')
}

exports.escapeHtml = str => {
  const map = {
    '&': '&amp;',
    '<': '&lt;',
    '>': '&gt;',
    '"': '&quot;',
    "'": '&#39;'
  }
  return str.replace(/[&<>"']/g, m => { return map[m] })
}

exports.pluralize = str => {
  const irregular = {
    'man': 'men',
    'woman': 'women',
    'child': 'children',
    'tooth': 'teeth',
    'foot': 'feet',
    'mouse': 'mice',
    'belief': 'beliefs'
  }

  const uncountable = [
    'equipment', 'information', 'rice', 'money', 'species', 'series', 'fish',
    'sheep', 'deer', 'aircraft', 'software', 'jeans', 'police'
  ]
  if (irregular[str]) {
    return irregular[str]
  }

  if (uncountable.indexOf(str) >= 0) {
    return str
  }

  if (str.slice(-3) === 'ies') {
    return str
  } else if (str.slice(-1) === 's') {
    return str
  } else if (str.slice(-2) === 'sh' || str.slice(-2) === 'ch') {
    return str + 'es'
  } else {
    return str + 's'
  }
}

