package com.afollestad.materialdialogs.folderselector;

import android.app.Application;
import android.support.annotation.NonNull;
import android.support.v7.widget.RecyclerView;
import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;
import android.widget.ImageView;
import android.widget.TextView;
import com.afollestad.materialdialogs.MaterialDialog;
import com.afollestad.materialdialogs.internal.MDTintHelper;
import com.afollestad.materialdialogs.internal.ThemeSingleton;
import io.github.aafactory.commons.R;

/** @author Aidan Follestad (afollestad) */
public class FolderChooserDialogAdapter extends RecyclerView.Adapter<FolderChooserDialogAdapter.FolderViewHolder> {

  private static final MaterialDialog.ListCallback EMPTY_CALLBACK =
      new MaterialDialog.ListCallback() {
        @Override
        public void onSelection(MaterialDialog dialog, View itemView, int which, CharSequence text) {}
      };

  private FolderChooserDialog mDialog;
  private final LayoutInflater mLayoutInflater;
  private MaterialDialog.ListCallback mListCallback;

  public FolderChooserDialogAdapter(
      Application context, FolderChooserDialog dialog, MaterialDialog.ListCallback listCallback) {
    mListCallback = listCallback;
    mDialog = dialog;
    mLayoutInflater = LayoutInflater.from(context);
  }

  @Override
  public FolderViewHolder onCreateViewHolder(ViewGroup parent, int viewType) {
    final View view = mLayoutInflater.inflate(R.layout.md_folder_chooser_item, parent, false);
    return new FolderViewHolder(view, mDialog);
  }

  @Override
  public void onBindViewHolder(FolderViewHolder holder, int position) {
    final FileChooser.FileItem item = mDialog.getFiles().get(position);
    final boolean isDirectory = item.isDirectory;

    holder.fileName.setText(item.name);
    holder.directoryIcon.setVisibility(isDirectory ? View.VISIBLE : View.GONE);
    holder.itemView.setActivated(mDialog.getSelection().contains(item));
    holder.itemView.setSelected(mDialog.getSelection().contains(item));
    if (mDialog.getSelection().contains(item)) {
      MDTintHelper.setTint(holder.fileName, ThemeSingleton.get().positiveColor);
    } else if (item.isDirectory) {
      MDTintHelper.setTint(holder.fileName, ThemeSingleton.get().neutralColor);
    }
  }

  @Override
  public int getItemCount() {
    return mDialog.getFiles().size();
  }

  public static class FolderViewHolder extends RecyclerView.ViewHolder
      implements View.OnClickListener, View.OnLongClickListener {

    final TextView fileName;
    final ImageView directoryIcon;
    private FolderChooserDialog mDialog;

    public FolderViewHolder(@NonNull View itemView, FolderChooserDialog dialog) {
      super(itemView);
      mDialog = dialog;

      fileName = itemView.findViewById(R.id.file_name);
      directoryIcon = itemView.findViewById(R.id.directory_icon);
      itemView.setOnClickListener(this);
      itemView.setOnLongClickListener(this);
    }

    @Override
    public void onClick(View v) {
      final FileChooser.FileItem item = mDialog.getFiles().get(getAdapterPosition());
      if (item.isDirectory) {
        mDialog.setCurrentDirectory(item);
      } else {
        if (!mDialog.getSelection().contains(item)) {
          mDialog.getSelection().add(item);
          fileName.setTextColor(ThemeSingleton.get().positiveColor);
        } else {
          mDialog.getSelection().remove(item);
          fileName.setTextColor(ThemeSingleton.get().neutralColor);
        }
        mDialog.notifyItemChanged(getAdapterPosition());
        if (mDialog.getSelection().size() > 0) {
          mDialog.setActionButton(MaterialDialog.ButtonCallback.POSITIVE, true);
        } else {
          mDialog.setActionButton(MaterialDialog.ButtonCallback.POSITIVE, false);
        }
      }
      if (mDialog.getSelection().size() == 0) {
        mDialog.setListCallback(EMPTY_CALLBACK);
      } else {
        mDialog.setListCallback(mListCallback);
      }
    }

    private MaterialDialog.ListCallback mListCallback =
        new MaterialDialog.ListCallback() {
          @Override
          public void onSelection(
              @NonNull MaterialDialog dialog,
              @NonNull View itemView,
              int which,
              @NonNull CharSequence text) {
            onClick(itemView);
          }
        };

    @Override
    public boolean onLongClick(View v) {
      if (mDialog.longPressCallback != null) {
        final FileChooser.FileItem item = mDialog.getFiles().get(getAdapterPosition());
        mDialog.longPressCallback.onLongPress(
            mDialog, v, item.name, FileChooser.FileItem.getItemPath(item));
        return true;
      }
      return false;
    }
  }
}

