function SistemaDePagamento(desconto) {
    this.desconto = desconto;
}

SistemaDePagamento.prototype.calcularDesconto = function (valorCompra) {
    return valorCompra - (valorCompra * (this.desconto / 100));
};

function Visa(desconto) {
    SistemaDePagamento.call(this, desconto);
}

Visa.prototype = new SistemaDePagamento;

function MasterCard(desconto) {
    SistemaDePagamento.call(this, desconto);
}

MasterCard.prototype = new SistemaDePagamento;

const visa = new Visa(10);
console.log(visa.calcularDesconto(100)); // 90

const masterCard = new MasterCard(15);
console.log(masterCard.calcularDesconto(100)); // 85

using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using Photon.Pun;

public class SpawnPlayers : MonoBehaviour
{
    public GameObject player;

    private Transform[] spawnPoints;
    private int spawnIndex;

    private void Start()
    {
        // if (PhotonNetwork.IsConnected)
        // {
        //     gameObject.name = "NetworkPlayer" + PhotonNetwork.LocalPlayer.ActorNumber;
        // }
        // else
        // {
        //     gameObject.name = "Player";
        // }

        spawnPoints = new Transform[transform.childCount];
        for (int i = 0; i < spawnPoints.Length; i++)
        {
            spawnPoints[i] = transform.GetChild(i);
        }
    }

    private void OnTriggerEnter(Collider other)
    {
        if (!PhotonNetwork.IsConnected)
        {
            if (other.CompareTag("Player") && other.gameObject.GetComponent<PhotonView>().IsMine)
            {
                Respawn(other.gameObject);
            }
        }
    }

    public void Respawn(GameObject player)
    {
        spawnIndex = Random.Range(0, spawnPoints.Length);
        player.transform.position = spawnPoints[spawnIndex].position;
    }
}

